    { name = "fastapi" },
    { name = "global-logger" },
    { name = "google-api-python-client" },
    { name = "google-auth-oauthlib" },
    { name = "knockknock" },
    { name = "oauth2client" },
    { name = "pendulum" },
    { name = "python-worker" },
    { name = "python-youtube" },
    { name = "pyyaml" },
    { name = "sqlalchemy" },
    { name = "trustme" },
    { name = "uvicorn" },
]

[package.dev-dependencies]
dev = [
    { name = "pre-commit" },
    { name = "ruff" },
]

[package.metadata]
requires-dist = [
    { name = "fastapi", specifier = ">=0.115.7" },
    { name = "global-logger", specifier = ">=0.4.2" },
    { name = "google-api-python-client", specifier = ">=2.159.0" },
    { name = "google-auth-oauthlib", specifier = ">=1.2.1" },
    { name = "knockknock", specifier = ">=0.1.8.1" },
    { name = "oauth2client", specifier = ">=4.1.3" },
    { name = "pendulum", specifier = ">=3.0.0" },
    { name = "python-worker", specifier = ">=2.2.4" },
    { name = "python-youtube", specifier = ">=0.9.7" },
    { name = "pyyaml", specifier = ">=6.0.2" },
    { name = "sqlalchemy", specifier = ">=2.0.37" },
    { name = "trustme", specifier = ">=1.2.1" },
    { name = "uvicorn", specifier = ">=0.34.0" },
]

[package.metadata.requires-dev]
dev = [
    { name = "pre-commit", specifier = ">=4.1.0" },
    { name = "ruff", specifier = ">=0.9.3" },
]
